import React from "react";
import { Row, Card, Col, Button, Nav, Image } from "react-bootstrap";
export default function CreateCategory() {

    
  return (
    <>
      <Row>
        <Col xl="6">
          <div class="card-body">
            <div class="basic-form">
              <form>
                <div class="form-group mb-3">
                  <input
                    class="form-control form-control-lg"
                    type="text"
                    //   defaultValue={}
                    //   onChange={(e) => {
                    //     console.log(e.target.value);
                    //     if (!e.target.value == "") {
                    //       setName(e.target.value);
                    //     } else {
                    //       setName(a?.name);
                    //     }
                    //   }}
                  />
                </div>
              </form>
            </div>
          </div>
        </Col>
        <Col xl="6">
          <div class="card-body">
            <div class="basic-form">
              <form>
                <div class="form-group mb-3">
                  <input
                    class="form-control form-control-lg"
                    type="text"

                    //   onChange={(e) => setDescription(e.target.value)}
                  />
                </div>
              </form>
            </div>
          </div>
        </Col>
        <Col xl="6">
          <div class="card-body">
            <div class="basic-form">
              <form>
                <div class="form-group mb-3">
                  <input
                    class="form-control form-control-lg"
                    type="file"
                    placeholder="image"
                  />
                </div>
              </form>
            </div>
          </div>
        </Col>
        <Button
          className="me-2"
          variant="primary btn-lg"
           
        >
          Create Category
        </Button>
      </Row>
    </>
  );
}
